package com.example;

import org.springframework.boot.SpringApplication;
import org.springframework.boot.autoconfigure.SpringBootApplication;
import org.springframework.web.bind.annotation.RequestMapping;
import org.springframework.web.bind.annotation.RestController;

@SpringBootApplication
@RestController
public class SpringBootJenkinsWorkshopApplication {
    private static long counter = 0;

    private static String jenkins_img = "<img alt=\"jenkins\" src=\"data:image/png;base64,\">";

    public static void main(String[] args) {
        SpringApplication.run(SpringBootJenkinsWorkshopApplication.class, args);
    }

    @RequestMapping("/")
    String home() {
        String msg = String.format("Hello Jenkins!  (%s)", counter++);

        System.out.println("the index page accessed: " + counter + " times!");
        return String.format("<html><head><title>%s</title></title><body><h3>%s</h3><br/><br/>%s</body></html>", msg, msg, jenkins_img);
    }
}
